AAAABwAAAAEAAAAAAAAAAQAAABkYXRlAAAAAAQABAAEAAAAQAQAAEFSUk9XMQ==\"/\u003e\u003c/Page\u003e\u003cPage label=\"Gradient Boosting Model\"\u003e\u003cText\u003e\u003c![CDATA[## Gradient Boosting Model]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[Kerry Back, November 28, 2022]]\u003e\u003c/Text\u003e\u003cGroup columns=\"2\"\u003e\u003cText\u003e\u003c![CDATA[The features are roeq and mom12m.  The feature pipeline is (QuantileTransformer, \n    PolynomialFeatures, QuantileTransformer).  The target is the return minus the\n    market return and is transformed with QuantileTransformer.  Gradient boosted forests with\n    learning_rate=0.01 are trained at five-year intervals and used to predict monthly.  The best\n    and worst returns are the equally weighted returns of the top 100 and bottom 100 stocks\n    each month, respectively.]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" size=\"19658\" uploaded_filename=\"dp-tmp-jf2iopu0.pl.json\" responsive=\"true\" scale=\"1.0\" src=\"data:application/vnd.plotly.v1+json;base64,IntcImRhdGFcIjpbe1wiaG92ZXJ0ZW1wbGF0ZVwiOlwiYmVzdCA9ICQle3k6LjJmfTxleHRyYT48L2V4dHJhPlwiLFwibW9kZVwiOlwibGluZXNcIixcIm5hbWVcIjpcImJlc3RcIixcInhcIjpbXCIyMDA1LTAxXCIsXCIyMDA1LTAyXCIsXCIyMDA1LTAzXCIsXCIyMDA1LTA0XCIsXCIyMDA1LTA1XCIsXCIyMDA1LTA2XCIsXCIyMDA1LTA3XCIsXCIyMDA1LTA4XCIsXCIyMDA1LTA5XCIsXCIyMDA1LTEwXCIsXCIyMDA1LTExXCIsXCIyMDA1LTEyXCIsXCIyMDA2LTAxXCIsXCIyMDA2LTAyXCIsXCIyMDA2LTAzXCIsXCIyMDA2LTA0XCIsXCIyMDA2LTA1XCIsXCIyMDA2LTA2XCIsXCIyMDA2LTA3XCIsXCIyMDA2LTA4XCIsXCIyMDA2LTA5XCIsXCIyMDA2LTEwXCIsXCIyMDA2LTExXCIsXCIyMDA2LTEyXCIsXCIyMDA3LTAxXCIsXCIyMDA3LTAyXCIsXCIyMDA3LTAzXCIsXCIyMDA3LTA0XCIsXCIyMDA3LTA1XCIsXCIyMDA3LTA2XCIsXCIyMDA3LTA3XCIsXCIyMDA3LTA4XCIsXCIyMDA3LTA5XCIsXCIyMDA3LTEwXCIsXCIyMDA3LTExXCIsXCIyMDA3LTEyXCIsXCIyMDA4LTAxXCIsXCIyMDA4LTAyXCIsXCIyMDA4LTAzXCIsXCIyMDA4LTA0XCIsXCIyMDA4LTA1XCIsXCIyMDA4LTA2XCIsXCIyMDA4LTA3XCIsXCIyMDA4LTA4XCIsXCIyMDA4LTA5XCIsXCIyMDA4LTEwXCIsXCIyMDA4LTExXCIsXCIyMDA4LTEyXCIsXCIyMDA5LTAxXCIsXC
